INSERT INTO `wp_content` VALUES ('24', 'UEditor的配置和使用(单独图片与文件上传)', '<pre class=\"brush:js;toolbar:false\">//定义一个按钮点击上传图片\n&lt;input&nbsp;type=&quot;button&quot;&nbsp;value=&quot;点击上传图片&quot;&nbsp;onclick=&quot;openDialog()&quot;/&gt;\n\n&lt;!--&nbsp;需要引入的JS忽略&nbsp;--&gt;\n&lt;!--&nbsp;定义初始化容器的位置&nbsp;--&gt;\n&lt;script&nbsp;id=&quot;ban&quot;&nbsp;type=&quot;text/plain&quot;&nbsp;style=&quot;width:1210px;height:150px&quot;&gt;&lt;/script&gt;\n&lt;script&nbsp;type=&quot;text/javascript&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//根据ID初始化UEditor容器\n	var&nbsp;_editor&nbsp;=&nbsp;UE.getEditor(&quot;ban&quot;);\n		\n	_editor.ready(function&nbsp;()&nbsp;{\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//设置编辑器不可用\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//_editor.setDisabled();&nbsp;&nbsp;这个地方要注意&nbsp;一定要屏蔽\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//隐藏编辑器，因为不会用到这个编辑器实例，所以要隐藏\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;_editor.hide();\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//侦听图片上传\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;_editor.addListener(&#39;beforeinsertimage&#39;,&nbsp;function&nbsp;(t,&nbsp;arg)&nbsp;{\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//将地址赋值给相应的input,只去第一张图片的路径\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;var&nbsp;imgs;\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;for(var&nbsp;a&nbsp;in&nbsp;arg){\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;imgs&nbsp;+=arg[a].src+&#39;,&#39;;\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$(&quot;#img&quot;).attr(&quot;value&quot;,&nbsp;arg[0].src);\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//图片预览\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$(&quot;#img&quot;).attr(&quot;src&quot;,&nbsp;arg[0].src);\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;})\n\n	&nbsp;});\n	&nbsp;//打开图片上传组件\n	function&nbsp;openDialog(){\n	&nbsp;&nbsp;&nbsp;&nbsp;_editor.getDialog(&quot;insertimage&quot;).open();\n	}\n&lt;/script&gt;</pre><p><br/></p>', '2017-08-17 17:08:45', null, 'pages/c/2017/08/17/bmJVCF2XSW.html', null, 'http://localhost:8080/blog/upload/image/2017-08-17_086709_s1.jpg', '0', '0', '1', '2', '0', '0', '22', '0', '0', 'UEditor，UEditor图片上传，UEditor文件上传', 'UEditor的配置和使用单独的图片上传', 'Nszwxiaop');
INSERT INTO `wp_content` VALUES ('25', 'Java使用Redis', '<p>					</p><p><br/></p><p><br/></p><p style=\"white-space: normal;\"><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\">一：Linux下Redis的安装：</span></p><p><span style=\"font-size: 18px;\">&nbsp;1.Redis下载 从官网直接下载(<a href=\"http://download.redis.io/releases/\" target=\"_blank\" title=\"Redis官网下载地址\">Redis官网下载地址</a>)之后上传到Linux服务器</span></p><p><span style=\"font-size: 18px;\">&nbsp;2.直接使用wget 下载<br/></span></p><pre class=\"brush:bash;toolbar:false\">wget&nbsp;http://download.redis.io/releases/redis-4.0.1.tar.gz</pre><p style=\"white-space: normal;\"><span style=\"font-size: 18px;\"></span>&nbsp;3.&nbsp;下载好之后开始安装Redis</p><pre class=\"brush:bash;toolbar:false\">#安装的前提条件\nyum&nbsp;-y&nbsp;install&nbsp;gcc&nbsp;gcc-c++&nbsp;\n#在redis的下载目录&nbsp;进行解压\ntar&nbsp;-zxf&nbsp;redis-4.0.1.tar.gz\n#进入解压出的目录\ncd&nbsp;redis-4.0.1\nmake\nmake&nbsp;install&nbsp;PREFIX=/usr/local/redis\n#安装完后启动redis&nbsp;默认是前端启动\n/usr/local/redis/bin/redis-server</pre><p style=\"white-space: normal;\">下载安装</p><p style=\"white-space: normal;\">&nbsp;&nbsp;<img src=\"http://test.wp970.com/blog/upload/image/2017-08-17_081435_install.png\" title=\"2017-08-17_081435_install.png\" alt=\"install.png\"/></p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;make之后</p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"http://test.wp970.com/blog/upload/image/2017-08-17_038495_make.png\" title=\"2017-08-17_038495_make.png\" alt=\"make.png\"/></p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;make install 之后再启动<br/></p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;启动成功<br/></p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"http://test.wp970.com/blog/upload/image/2017-08-17_005113_success.png\" title=\"2017-08-17_005113_success.png\" alt=\"success.png\"/></p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;<br/></p><p style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;把redis修改为后台启动模式<br/></p><pre class=\"brush:bash;toolbar:false\">&nbsp;&nbsp;#先从redis解压目录把redis.conf复制到安装目录\n&nbsp;&nbsp;cp&nbsp;redis-4.0.1/redis.conf&nbsp;/usr/local/redis/bin/\n&nbsp;&nbsp;#修改安装目录下的配置文件&nbsp;把daemonize&nbsp;改为yes\n&nbsp;&nbsp;daemonize&nbsp;yes</pre><p style=\"white-space: normal;\"><img src=\"http://test.wp970.com/blog/upload/image/2017-08-17_088453_conf.png\" title=\"2017-08-17_088453_conf.png\" alt=\"conf.png\"/></p><pre class=\"brush:bash;toolbar:false\">#修改好后启动重新启动redis\ncd&nbsp;/usr/local/redis/bin/&nbsp;#进入安装目录\n./redis-server&nbsp;redis.conf&nbsp;#启动redis</pre><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\"><br/></span></p><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\"><br/></span></p><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\">二：有Java测试是否连接成功</span><br/></p><pre class=\"brush:java;toolbar:false\">/*\n&nbsp;*&nbsp;使用jedis连接Redis\n&nbsp;*/\n@Test\npublic&nbsp;void&nbsp;redisSingle(){\n	//创建一个jedis的对象。\n	Jedis&nbsp;jedis&nbsp;=&nbsp;new&nbsp;Jedis(&quot;192.168.52.137&quot;,6379);\n	//添加数据\n	jedis.set(&quot;test&quot;,&nbsp;&quot;123&quot;);\n	String&nbsp;test&nbsp;=&nbsp;jedis.get(&quot;test&quot;);\n		\n	System.out.println(test);\n		\n\n}</pre><p>如图下连接成功</p><p><img src=\"http://test.wp970.com/blog/upload/image/2017-08-17_058182_jedis.png\" title=\"2017-08-17_058182_jedis.png\" alt=\"jedis.png\"/></p><p><br/></p><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\"><br/></span></p><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\">三：spring整合jedis</span></p><pre class=\"brush:xml;toolbar:false\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;连接池配置&nbsp;不配置使用jedis默认的连接池&nbsp;--&gt;\n	&lt;bean&nbsp;id=&quot;jedisPoolConfig&quot;&nbsp;class=&quot;redis.clients.jedis.JedisPoolConfig&quot;&gt;\n		&lt;!--&nbsp;最大连接数&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;maxTotal&quot;&nbsp;value=&quot;30&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;最大空闲连接数&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;maxIdle&quot;&nbsp;value=&quot;10&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;每次释放连接的最大数目&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;numTestsPerEvictionRun&quot;&nbsp;value=&quot;1024&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;释放连接的扫描间隔（毫秒）&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;timeBetweenEvictionRunsMillis&quot;&nbsp;value=&quot;30000&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;连接最小空闲时间&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;minEvictableIdleTimeMillis&quot;&nbsp;value=&quot;1800000&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;连接空闲多久后释放,&nbsp;当空闲时间&gt;该值&nbsp;且&nbsp;空闲连接&gt;最大空闲连接数&nbsp;时直接释放&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;softMinEvictableIdleTimeMillis&quot;&nbsp;value=&quot;10000&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;获取连接时的最大等待毫秒数,小于零:阻塞不确定的时间,默认-1&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;maxWaitMillis&quot;&nbsp;value=&quot;1500&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;在获取连接的时候检查有效性,&nbsp;默认false&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;testOnBorrow&quot;&nbsp;value=&quot;true&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;在空闲时检查有效性,&nbsp;默认false&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;testWhileIdle&quot;&nbsp;value=&quot;true&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;连接耗尽时是否阻塞,&nbsp;false报异常,ture阻塞直到超时,&nbsp;默认true&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;blockWhenExhausted&quot;&nbsp;value=&quot;false&quot;&nbsp;/&gt;\n	&lt;/bean&gt;	\n	&nbsp;&lt;!--&nbsp;redis单机版&nbsp;--&gt;&nbsp;&nbsp;&nbsp;\n	&nbsp;&lt;bean&nbsp;id=&quot;redisClient&quot;&nbsp;class=&quot;redis.clients.jedis.JedisPool&quot;&gt;\n	&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--引入配置好的连接池&nbsp;不配置默认使用org.apache.commons.pool2.impl.GenericObjectPoolConfig--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;constructor-arg&nbsp;name=&quot;poolConfig&quot;&nbsp;ref=&quot;jedisPoolConfig&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--ip地址--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;!---端口--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;6379&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;</pre><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\"></span><br/></p><p><span style=\"font-style: italic; font-weight: bold; line-height: 18px; font-size: 20px;\"><br/></span></p>', '2017-08-17 18:20:31', '2017-08-18 08:19:04', 'pages/c/2017/08/17/GpNyJ2nqMv.html', null, 'http://localhost:8080/blog/upload/image/2017-08-17_008170_redis.jpg', '0', '0', '1', '3', '0', '0', '28', '0', '0', 'Java缓存，Redis，Redis配置，Java配置Redis', 'Java使用Redis、Redis缓存的配置。Linux下的redis的安装；', 'Nszwxiaop');
INSERT INTO `wp_content` VALUES ('26', 'Linux下Redis集群搭建', '<p>					</p><p><br/></p><p><br/></p><p style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(79, 129, 189); font-size: 20px;\">Redis集群的搭建</span><br/><span style=\"background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\">搭建环境 ： centos7(使用多台服务器搭建集群，这里为了方面演示就在一台服务器上) &nbsp; &nbsp;redis-4.0.1 (</span><a href=\"http://download.redis.io/releases/\" target=\"_blank\" title=\"Redis下载地址\" style=\"text-decoration: underline; background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\">Redis官方下载地址</span></a><span style=\"background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\">)</span></span><br/></p><p style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\"><br/></span></span></p><p style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\">1.安装redis<br/></span></span></p><pre class=\"brush:bash;toolbar:false\">#下载redis源码包\nwget&nbsp;http://download.redis.io/releases/redis-4.0.1.tar.gz\n#安装的前提条件\nyum&nbsp;-y&nbsp;install&nbsp;gcc&nbsp;gcc-c++&nbsp;\n#在redis的下载目录&nbsp;进行解压\ntar&nbsp;-zxf&nbsp;redis-4.0.1.tar.gz\n#进入解压出的目录\ncd&nbsp;redis-4.0.1\nmake\nmake&nbsp;install&nbsp;PREFIX=/usr/local/redis\n#安装完成以后redis默认前台启动,需要修改配置文件改为后台启动\n#先从redis解压目录把redis.conf复制到安装目录\ncp&nbsp;redis-4.0.1/redis.conf&nbsp;/usr/local/redis/bin/\n#修改安装目录下的配置文件&nbsp;把daemonize&nbsp;改为yes\ndaemonize&nbsp;yes</pre><p style=\"text-align: left;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(12, 12, 12);\"></span></span><img src=\"http://test.wp970.com/blog//upload/image/2017-08-17_088453_conf.png\" alt=\"2017-08-17_088453_conf.png\"/></p><p style=\"text-align: left;\">2.开始创建Redis集群</p><pre class=\"brush:bash;toolbar:false\">#第一步需要创建多个Redis实例\nmkdir&nbsp;/usr/local/redis-cluster&nbsp;&nbsp;#创建一个文件夹将所有实例放入\ncd&nbsp;/usr/local/redis-cluster&nbsp;\ncp&nbsp;../redis/bin/&nbsp;redis01&nbsp;-rf&nbsp;#删除dump.rdb\ncp&nbsp;redis01&nbsp;redis02&nbsp;-rf&nbsp;#一个复制六个实例</pre><p style=\"text-align: left;\">创建好如下：</p><p style=\"text-align: left;\"><img src=\"http://test.wp970.com/blog/upload/image/2017-08-18_025928_redis-cluster.png\" title=\"2017-08-18_025928_redis-cluster.png\" alt=\"redis-cluster.png\"/></p><pre class=\"brush:bash;toolbar:false\">#分别修改对应配置文件\n#端口修改为7001到7006\n#把集群配置注解去掉</pre><p style=\"text-align: left;\"><img src=\"http://test.wp970.com/blog/upload/image/2017-08-18_046696_redis-cluster-port.png\" title=\"2017-08-18_046696_redis-cluster-port.png\" alt=\"redis-cluster-port.png\"/></p><p style=\"text-align: left;\"><img src=\"http://test.wp970.com/blog/upload/image/2017-08-18_017347_redis-cluster-config.png\" title=\"2017-08-18_017347_redis-cluster-config.png\" alt=\"redis-cluster-config.png\"/></p><pre class=\"brush:bash;toolbar:false\">#配置好之后启动实例\ncd&nbsp;redis01\n./redis-server&nbsp;redis.conf\ncd&nbsp;..\ncd&nbsp;redis02\n./redis-server&nbsp;redis.conf\ncd&nbsp;..\ncd&nbsp;redis03\n./redis-server&nbsp;redis.conf\ncd&nbsp;..\ncd&nbsp;redis04\n./redis-server&nbsp;redis.conf\ncd&nbsp;..\ncd&nbsp;redis05\n./redis-server&nbsp;redis.conf\ncd&nbsp;..\ncd&nbsp;redis06\n./redis-server&nbsp;redis.conf\ncd&nbsp;..</pre><p style=\"text-align: left;\">启动成功：</p><p style=\"text-align: left;\"><img src=\"http://test.wp970.com/blog/upload/image/2017-08-18_007180_redis-cluster-start.png\" title=\"2017-08-18_007180_redis-cluster-start.png\" alt=\"redis-cluster-start.png\"/></p><pre class=\"brush:bash;toolbar:false\">#开始创建集群&nbsp;首先从源文件夹目录下的src下把redis-trib.rb复制过来\ncp&nbsp;redis-4.0.1/src/redis-trib.rb&nbsp;/usr/local/redis-cluster/\n#创建集群(使用redis-trib.rb&nbsp;需要安装Ruby)\n\n#Ruby的安装\nyum&nbsp;install&nbsp;ruby\nyum&nbsp;install&nbsp;rubygems\ngem&nbsp;install&nbsp;redis\n\n#安装好之后\n./redis-trib.rb&nbsp;create&nbsp;--replicas&nbsp;1&nbsp;192.168.52.137:7001&nbsp;192.168.52.137:7002&nbsp;\n192.168.52.137:7003&nbsp;192.168.52.137:7004&nbsp;192.168.52.137:7005&nbsp;&nbsp;192.168.52.137:7006\n#注意：\n#如果执行时报如下错误\n[ERR]&nbsp;Node&nbsp;192.168.52.137:7001&nbsp;is&nbsp;not&nbsp;empty.&nbsp;Either&nbsp;the&nbsp;node&nbsp;already&nbsp;knows&nbsp;other&nbsp;nodes&nbsp;\n(check&nbsp;with&nbsp;CLUSTER&nbsp;NODES)&nbsp;or&nbsp;contains&nbsp;some&nbsp;key&nbsp;in&nbsp;database&nbsp;0.\n#进入redis清空数据库\n192.168.52.137:7001&gt;&nbsp;flushdb\n\n#如果如下错误\n/usr/local/share/gems/gems/redis-3.3.3/lib/redis/client.rb:121:in&nbsp;`call&#39;:&nbsp;ERR&nbsp;Slot&nbsp;0&nbsp;is&nbsp;already&nbsp;busy&nbsp;(Redis::CommandError)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;/usr/local/share/gems/gems/redis-3.3.3/lib/redis.rb:2705:in&nbsp;`block&nbsp;in&nbsp;method_missing&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;/usr/local/share/gems/gems/redis-3.3.3/lib/redis.rb:58:in&nbsp;`block&nbsp;in&nbsp;synchronize&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;/usr/share/ruby/monitor.rb:211:in&nbsp;`mon_synchronize&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;/usr/local/share/gems/gems/redis-3.3.3/lib/redis.rb:58:in&nbsp;`synchronize&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;/usr/local/share/gems/gems/redis-3.3.3/lib/redis.rb:2704:in&nbsp;`method_missing&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;./redis-trib.rb:212:in&nbsp;`flush_node_config&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;./redis-trib.rb:776:in&nbsp;`block&nbsp;in&nbsp;flush_nodes_config&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;./redis-trib.rb:775:in&nbsp;`each&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;./redis-trib.rb:775:in&nbsp;`flush_nodes_config&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;./redis-trib.rb:1296:in&nbsp;`create_cluster_cmd&#39;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;from&nbsp;./redis-trib.rb:1700:in&nbsp;`&lt;main&gt;&#39;\n#&nbsp;只要指定redis.conf中的&nbsp;cluster-config-file&nbsp;\n\n#重新启动一下&nbsp;在执行\n./redis-trib.rb&nbsp;create&nbsp;--replicas&nbsp;1&nbsp;192.168.52.137:7001&nbsp;192.168.52.137:7002&nbsp;\n192.168.52.137:7003&nbsp;192.168.52.137:7004&nbsp;192.168.52.137:7005&nbsp;&nbsp;192.168.52.137:7006</pre><p style=\"text-align: left;\">成功之后如下：</p><p style=\"text-align: left;\"><img src=\"http://test.wp970.com/blog/upload/image/2017-08-18_067387_redis-cluster-success.png\" title=\"2017-08-18_067387_redis-cluster-success.png\" alt=\"redis-cluster-success.png\"/></p><p style=\"text-align: left;\">3.测试redis集群</p><pre class=\"brush:bash;toolbar:false\">[root@localhost&nbsp;redis01]#&nbsp;./redis-cli&nbsp;-c&nbsp;-h&nbsp;192.168.52.137&nbsp;-p&nbsp;7001&nbsp;&nbsp;#进入集群\n192.168.52.137:7001&gt;&nbsp;set&nbsp;name&nbsp;wxiaop\n-&gt;&nbsp;Redirected&nbsp;to&nbsp;slot&nbsp;[5798]&nbsp;located&nbsp;at&nbsp;192.168.52.137:7002&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;#表示成功\nOK\n192.168.52.137:7002&gt;&nbsp;set&nbsp;password&nbsp;123\nOK\n192.168.52.137:7002&gt;&nbsp;get&nbsp;name\n&quot;wxiaop&quot;\n192.168.52.137:7002&gt;&nbsp;get&nbsp;password\n&quot;123&quot;\n192.168.52.137:7002&gt;&nbsp;cluster&nbsp;info\ncluster_state:ok\ncluster_slots_assigned:16384\ncluster_slots_ok:16384\ncluster_slots_pfail:0\ncluster_slots_fail:0\ncluster_known_nodes:6\ncluster_size:3\ncluster_current_epoch:6\ncluster_my_epoch:2\ncluster_stats_messages_ping_sent:12013\ncluster_stats_messages_pong_sent:13118\ncluster_stats_messages_meet_sent:3\ncluster_stats_messages_sent:25134\ncluster_stats_messages_ping_received:13115\ncluster_stats_messages_pong_received:12016\ncluster_stats_messages_meet_received:3\ncluster_stats_messages_received:25134\n192.168.52.137:7002&gt;&nbsp;set&nbsp;a&nbsp;100\n-&gt;&nbsp;Redirected&nbsp;to&nbsp;slot&nbsp;[15495]&nbsp;located&nbsp;at&nbsp;192.168.52.137:7003\nOK\n192.168.52.137:7003&gt;</pre><p style=\"text-align: left;\"><br/></p>', '2017-08-18 09:13:20', '2017-08-18 16:32:50', 'pages/c/2017/08/18/FRI7ghSyw4.html', null, 'http://localhost:8080/blog/upload/image/2017-08-18_010801_redis-clusterl.jpg', '0', '0', '1', '3', '0', '0', '15', '0', '0', 'Redis集群，集群搭建，redis搭建，Linux安装Redis集群，Linux', 'Linux环境下搭建Redis集群，Redis集群的搭建与配置', 'Nszwxiaop');
INSERT INTO `wp_content` VALUES ('27', 'Java使用Jedis操作Redis集群', '<p>					</p><p>1.测试集群是否连接成功<br/></p><pre class=\"brush:java;toolbar:false\">@Test\npublic&nbsp;void&nbsp;testJedisCluster()&nbsp;{\n	\n	HashSet&lt;HostAndPort&gt;&nbsp;nodes&nbsp;=&nbsp;new&nbsp;HashSet&lt;&gt;();\n	//添加节点\n	nodes.add(new&nbsp;HostAndPort(&quot;192.168.52.130&quot;,&nbsp;7001));\n	nodes.add(new&nbsp;HostAndPort(&quot;192.168.52.130&quot;,&nbsp;7002));\n	nodes.add(new&nbsp;HostAndPort(&quot;192.168.52.130&quot;,&nbsp;7003));\n	nodes.add(new&nbsp;HostAndPort(&quot;192.168.52.130&quot;,&nbsp;7004));\n	nodes.add(new&nbsp;HostAndPort(&quot;192.168.52.130&quot;,&nbsp;7005));\n	nodes.add(new&nbsp;HostAndPort(&quot;192.168.52.130&quot;,&nbsp;7006));\n		\n	JedisCluster&nbsp;cluster&nbsp;=&nbsp;new&nbsp;JedisCluster(nodes);\n		\n	cluster.set(&quot;key1&quot;,&nbsp;&quot;1000&quot;);\n	String&nbsp;string&nbsp;=&nbsp;cluster.get(&quot;key1&quot;);\n	System.out.println(string);\n		\n	cluster.close();\n}</pre><p>2.spring整合jedis集群</p><pre class=\"brush:xml;toolbar:false\">&lt;!--&nbsp;连接池配置&nbsp;不配置使用默认&nbsp;--&gt;\n	&lt;bean&nbsp;id=&quot;jedisPoolConfig&quot;&nbsp;class=&quot;redis.clients.jedis.JedisPoolConfig&quot;&gt;\n		&lt;!--&nbsp;最大连接数&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;maxTotal&quot;&nbsp;value=&quot;30&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;最大空闲连接数&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;maxIdle&quot;&nbsp;value=&quot;10&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;每次释放连接的最大数目&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;numTestsPerEvictionRun&quot;&nbsp;value=&quot;1024&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;释放连接的扫描间隔（毫秒）&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;timeBetweenEvictionRunsMillis&quot;&nbsp;value=&quot;30000&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;连接最小空闲时间&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;minEvictableIdleTimeMillis&quot;&nbsp;value=&quot;1800000&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;连接空闲多久后释放,&nbsp;当空闲时间&gt;该值&nbsp;且&nbsp;空闲连接&gt;最大空闲连接数&nbsp;时直接释放&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;softMinEvictableIdleTimeMillis&quot;&nbsp;value=&quot;10000&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;获取连接时的最大等待毫秒数,小于零:阻塞不确定的时间,默认-1&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;maxWaitMillis&quot;&nbsp;value=&quot;1500&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;在获取连接的时候检查有效性,&nbsp;默认false&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;testOnBorrow&quot;&nbsp;value=&quot;true&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;在空闲时检查有效性,&nbsp;默认false&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;testWhileIdle&quot;&nbsp;value=&quot;true&quot;&nbsp;/&gt;\n		&lt;!--&nbsp;连接耗尽时是否阻塞,&nbsp;false报异常,ture阻塞直到超时,&nbsp;默认true&nbsp;--&gt;\n		&lt;property&nbsp;name=&quot;blockWhenExhausted&quot;&nbsp;value=&quot;false&quot;&nbsp;/&gt;\n	&lt;/bean&gt;	\n&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;redis集群版客服端&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;redisClientCluster&quot;&nbsp;class=&quot;redis.clients.jedis.JedisCluster&quot;&gt;\n		&lt;constructor-arg&nbsp;name=&quot;nodes&quot;&gt;\n			&lt;set&gt;\n				&lt;bean&nbsp;class=&quot;redis.clients.jedis.HostAndPort&quot;&gt;\n					&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&gt;&lt;/constructor-arg&gt;\n					&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;7001&quot;&gt;&lt;/constructor-arg&gt;\n				&lt;/bean&gt;\n				&lt;bean&nbsp;class=&quot;redis.clients.jedis.HostAndPort&quot;&gt;\n					&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&gt;&lt;/constructor-arg&gt;\n					&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;7002&quot;&gt;&lt;/constructor-arg&gt;\n				&lt;/bean&gt;\n				&lt;bean&nbsp;class=&quot;redis.clients.jedis.HostAndPort&quot;&gt;\n					&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&gt;&lt;/constructor-arg&gt;\n					&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;7003&quot;&gt;&lt;/constructor-arg&gt;\n				&lt;/bean&gt;\n				&lt;bean&nbsp;class=&quot;redis.clients.jedis.HostAndPort&quot;&gt;\n					&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&gt;&lt;/constructor-arg&gt;\n					&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;7004&quot;&gt;&lt;/constructor-arg&gt;\n				&lt;/bean&gt;\n				&lt;bean&nbsp;class=&quot;redis.clients.jedis.HostAndPort&quot;&gt;\n					&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&gt;&lt;/constructor-arg&gt;\n					&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;7005&quot;&gt;&lt;/constructor-arg&gt;\n				&lt;/bean&gt;\n				&lt;bean&nbsp;class=&quot;redis.clients.jedis.HostAndPort&quot;&gt;\n					&lt;constructor-arg&nbsp;name=&quot;host&quot;&nbsp;value=&quot;192.168.52.130&quot;&gt;&lt;/constructor-arg&gt;\n					&lt;constructor-arg&nbsp;name=&quot;port&quot;&nbsp;value=&quot;7006&quot;&gt;&lt;/constructor-arg&gt;\n				&lt;/bean&gt;\n			&lt;/set&gt;\n		&lt;/constructor-arg&gt;\n		&lt;constructor-arg&nbsp;name=&quot;poolConfig&quot;&nbsp;ref=&quot;jedisPoolConfig&quot;&gt;&lt;/constructor-arg&gt;\n	&lt;/bean&gt;</pre><p><br/></p>', '2017-08-18 16:27:07', '2017-08-18 17:49:38', 'pages/c/2017/08/18/tJhKNRpm3u.html', null, 'http://localhost:8080/blog/upload/image/2017-08-18_027699_java-jedis-clusterl.jpg', '0', '0', '1', '3', '0', '0', '27', '0', '0', 'Jedis的使用，Jedis操作集群，Redis集群，Java缓存配置，Java集群操作', 'Java使用Jedis操作Redis集群', 'Nszwxiaop');
INSERT INTO `wp_content` VALUES ('28', 'Centos7使用rpm方式安装mysql', '<p><br/></p><p><br/></p><p><br/></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: center; margin: 0px 0px 20px;\"><strong>Centos7使用rpm方式安装mysql</strong></h1><p><a href=\"https://dev.mysql.com/downloads/repo/yum/\" target=\"_blank\" title=\"rpm安装包下载地址\">rpm安装包下载地址</a><br/></p><p>环境：<span style=\"color: rgb(255, 0, 0);\">Centos7.3.1611</span></p><p>rpm安装包：<span style=\"background-color: rgb(255, 255, 255); color: rgb(255, 0, 0);\">mysql57-community-release-el7-11.noarch.rpm</span></p><p><br/></p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>安装仓库列表：</p><pre class=\"brush:bash;toolbar:false\">yum&nbsp;localinstall&nbsp;mysql57-community-release-el7-11.noarch.rpm</pre><p><br/></p><p><br/></p><p><img src=\"http://test.wp970.com/blog/upload/image/2018-03-06_097551_安装之后.png\" title=\"2018-03-06_097551_安装之后.png\" alt=\"安装之后.png\"/><br/></p></li><li><p>安装mysql：</p><pre class=\"brush:bash;toolbar:false\">yum&nbsp;install&nbsp;mysql-community-server</pre><p><br/></p><p><img src=\"http://test.wp970.com/blog/upload/image/2018-03-06_016087_mysql-community-server.png\" title=\"2018-03-06_016087_mysql-community-server.png\" alt=\"mysql-community-server.png\"/><br/></p></li><li><p>启动mysql：</p><pre class=\"brush:bash;toolbar:false\">systemctl&nbsp;start&nbsp;mysqld.service&nbsp;&nbsp;#什么都没提示就表明启动成功了\n\nsystemctl&nbsp;status&nbsp;mysqld.service&nbsp;&nbsp;&nbsp;#查看MySQL的运行状态</pre><p><br/></p></li><li><p>设置root密码<br/><br/>MySQL5.7开始 为了加强安全性mysql为root生成了一个随机密码放在了<span style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(254, 254, 242);\">/var/log/mysqld.log<br/><br/></span></p><pre class=\"brush:bash;toolbar:false\">grep&nbsp;&#39;temporary&nbsp;password&#39;&nbsp;/var/log/mysqld.log&nbsp;&nbsp;#使用这个也可以查看到密码会得出下列信息&nbsp;\n#得到的随机密码信息\nNote]&nbsp;A&nbsp;temporary&nbsp;password&nbsp;is&nbsp;generated&nbsp;for&nbsp;root@localhost:&nbsp;g%1fulQh&gt;8fQ\n#登录mysql(输入你的随机密码就可正常登入)\nmysql&nbsp;-uroot&nbsp;-p&nbsp;\n#登录之后修改密码\nmysql&gt;&nbsp;ALTER&nbsp;USER&nbsp;&#39;root&#39;@&#39;localhost&#39;&nbsp;IDENTIFIED&nbsp;BY&nbsp;&#39;123456&#39;;&nbsp;#这里假设改为123456\n#你会发现会报这样一个错误(5.7开始修改一个简单的密码会报以下错误)\nERROR&nbsp;1819&nbsp;(HY000):&nbsp;Your&nbsp;password&nbsp;does&nbsp;not&nbsp;satisfy&nbsp;the&nbsp;current&nbsp;policy&nbsp;requirements</pre><p><br/></p><p style=\"margin: 10px auto; padding: 0px; line-height: 1.5; font-size: 13px; font-family: Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(254, 254, 242);\">这个其实与validate_password_policy的值有关。</p><p style=\"margin: 10px auto; padding: 0px; line-height: 1.5; font-size: 13px; font-family: Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(254, 254, 242);\">validate_password_policy有以下取值：</p><table><thead style=\"margin: 0px; padding: 0px;\"><tr style=\"margin: 0px; padding: 0px;\" class=\"firstRow\"><th style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse; word-break: break-all;\">Policy</th><th style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\">Tests Performed</th></tr></thead><tbody style=\"margin: 0px; padding: 0px;\"><tr style=\"margin: 0px; padding: 0px;\"><td style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\"><code class=\"literal\" style=\"margin: 0px; padding: 0px;\">0</code>&nbsp;or&nbsp;<code class=\"literal\" style=\"margin: 0px; padding: 0px;\">LOW</code></td><td style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\">Length</td></tr><tr style=\"margin: 0px; padding: 0px;\"><td style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\"><code class=\"literal\" style=\"margin: 0px; padding: 0px;\">1</code>&nbsp;or&nbsp;<code class=\"literal\" style=\"margin: 0px; padding: 0px;\">MEDIUM</code></td><td style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\">Length; numeric, lowercase/uppercase, and special characters</td></tr><tr style=\"margin: 0px; padding: 0px;\"><td style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\"><code class=\"literal\" style=\"margin: 0px; padding: 0px;\">2</code>&nbsp;or&nbsp;<code class=\"literal\" style=\"margin: 0px; padding: 0px;\">STRONG</code></td><td style=\"margin: 0px; padding: 3px; border-color: silver; border-collapse: collapse;\">Length; numeric, lowercase/uppercase, and special characters; dictionary file<br/><br/></td></tr></tbody></table><p>validate_password_policy的默认值为1(medium) 所以密码必须满足包含的条件<br/>(密码的长度(这与validate_password_length的长度有关)，且必须包含数字，大写字母或者小写字母，和特殊符号)<br/>为了方便测试我们一般都用的简单密码<br/>所以在这里必须修改两个全局参数<br/><br/><br/><br/></p><pre class=\"brush:bash;toolbar:false\">&nbsp;set&nbsp;global&nbsp;validate_password_policy=0;&nbsp;#修改为只验证长度\n&nbsp;set&nbsp;global&nbsp;validate_password_length=6;&nbsp;#长度为6位&nbsp;&nbsp;这样再修改简单的密码就可以了</pre><p><br/></p></li><li><p>MySQL远程连接授权<br/><br/>&nbsp; &nbsp;<span style=\"text-decoration: underline;\"><strong>想要远程连接数据库就必须给数据库授权和开发3306端口&nbsp;</strong></span><br/>&nbsp;&nbsp;&nbsp;&nbsp;1.给数据库授权<br/></p><pre class=\"brush:bash;toolbar:false\">&nbsp;#myuser表示开放的用户，mypassword表示账户密码(实际存在的用户名和密码)&nbsp;%表示开放的IP地址%表示所有IP\n&nbsp;GRANT&nbsp;ALL&nbsp;PRIVILEGES&nbsp;ON&nbsp;*.*&nbsp;TO&nbsp;&#39;myuser&#39;@&#39;%&#39;&nbsp;IDENTIFIED&nbsp;BY&nbsp;&#39;mypassword&#39;&nbsp;WITH&nbsp;GRANT&nbsp;OPTION;</pre><p>2.设置防火墙开发3306<br/></p><pre class=\"brush:bash;toolbar:false\">&nbsp;\n&nbsp;firewall-cmd&nbsp;--zone=public&nbsp;--add-port=3306/tcp&nbsp;--permanent\n&nbsp;#参数解释\n&nbsp;--zone&nbsp;#作用域\n&nbsp;--add-port=3306/tcp&nbsp;#添加端口，格式为：端口/通讯协议\n&nbsp;--permanent&nbsp;&nbsp;#永久生效，没有此参数重启后失效\n&nbsp;\n&nbsp;#重启防火墙生效\n&nbsp;systemctl&nbsp;restart&nbsp;firewalld.service</pre><p><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(254, 254, 242);\"></span></p><p><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(254, 254, 242);\"></span></p></li></ol><p><br/></p><p><img src=\"http://img.baidu.com/hi/tsj/t_0011.gif\"/>OK这样本地就可以连接了。</p><p><br/></p>', '2017-12-20 16:59:53', '2018-03-06 22:43:40', null, null, 'http://localhost:8080/blog/upload/image/2017-12-20_084965_timg.jpg', '0', '0', '1', '3', '0', '0', '2', '0', '0', 'Linux，MySQL，Linux下mysql安装，Centos7', 'Linux安装mysql，使用rpm方式安装mysql，Centos7安装mysql，Centos7使用rpm方式安装mysql', 'Nszwxiaop');
INSERT INTO `wp_content` VALUES ('29', 'Mysql配置主从服务器', '<p>					</p><h2 style=\"border-bottom-color:#cccccc;border-bottom-width:2px;border-bottom-style:solid;padding:0px 4px 0px 0px;margin:0px 0px 10px;text-align:center;\" class=\"ue_t\">mysql主从同步数据库配置</h2><p style=\"line-height:1.5em;\"><strong>环境：</strong></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">Linux：CentOS Linux release 7.3.1611 (Core)&nbsp;</span></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">MySQL：mysql&nbsp; Ver 14.14 Distrib 5.6.37</span></p><p style=\"text-indent:2em;\"><span style=\"font-size: 14px;\">server1：192.168.47.129</span></p><p style=\"text-indent:2em;\"><span style=\"font-size: 14px;\"><span style=\"font-size: 14px; text-indent: 32px;\">server2：192.168.47.180</span></span></p><p style=\"line-height:1.5em;\"><strong>修改配置文件(my.cnf位于/etc/my.cnf)：</strong></p><p style=\"line-height:1.5em;\"><span style=\"text-indent: 2em;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;server1在[mysqld]下添加：</span></p><pre class=\"brush:bash;toolbar:false\">server-id&nbsp;=&nbsp;1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;#本数据库的ID标识\nlog-bin&nbsp;=&nbsp;master-bin&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;#启用二进制日志\nlog-bin-index&nbsp;=&nbsp;master-bin.index&nbsp;&nbsp;&nbsp;#指定索引文件，此文件指示当前使用了哪个日志文件</pre><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;server2<span style=\"text-indent: 32px;\">在[mysqld]下添加：</span></p><pre class=\"brush:bash;toolbar:false\">server-id=2\nrelay-log-index=slave-relay-bin.index\nrelay-log&nbsp;=&nbsp;slave-relay-bin</pre><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;配置好之后重启服务；</p><p><strong>设置主从关系：</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;server1 进入mysql<br/></p><pre class=\"brush:bash;toolbar:false\">&nbsp;&nbsp;&nbsp;&nbsp;#查看配置是否正确\n&nbsp;&nbsp;&nbsp;&nbsp;mysql&gt;&nbsp;show&nbsp;master&nbsp;status;\n+-------------------+----------+--------------+------------------+-------------------+\n|&nbsp;File&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|&nbsp;Position&nbsp;|&nbsp;Binlog_Do_DB&nbsp;|&nbsp;Binlog_Ignore_DB&nbsp;|&nbsp;Executed_Gtid_Set&nbsp;|\n+-------------------+----------+--------------+------------------+-------------------+\n|&nbsp;master-bin.000001&nbsp;|&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;584&nbsp;|&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|\n+-------------------+----------+--------------+------------------+-------------------+\n1&nbsp;row&nbsp;in&nbsp;set&nbsp;(0.00&nbsp;sec)\n\n&nbsp;&nbsp;&nbsp;&nbsp;#创建一个账户\n&nbsp;&nbsp;&nbsp;&nbsp;create&nbsp;user&nbsp;&#39;testuser&#39;&nbsp;identified&nbsp;by&nbsp;&#39;testpassword&#39;;\n&nbsp;&nbsp;&nbsp;&nbsp;#&nbsp;运行从指定ip(这里是server2)使用用户testuser访问，访问密码为testpassword\n&nbsp;&nbsp;&nbsp;&nbsp;GRANT&nbsp;REPLICATION&nbsp;SLAVE&nbsp;ON&nbsp;*.*&nbsp;TO&nbsp;&#39;testuser&#39;@&#39;192.168.47.180&#39;&nbsp;IDENTIFIED&nbsp;BY&nbsp;&#39;testpassword&#39;;\n&nbsp;&nbsp;&nbsp;&nbsp;#刷新同步一下\n&nbsp;&nbsp;&nbsp;&nbsp;flush&nbsp;privileges;</pre><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;server2 进入mysql<br/></p><pre class=\"brush:bash;toolbar:false\">&nbsp;&nbsp;&nbsp;&nbsp;#设置master服务器的参数\n&nbsp;&nbsp;&nbsp;&nbsp;change&nbsp;master&nbsp;to&nbsp;master_host=&#39;192.168.47.129&#39;,master_port=3306,master_user=&#39;testuser&#39;,master_password=&#39;testpassword&#39;,master_log_file=&#39;master-bin.000001&#39;,master_log_pos=0;\n&nbsp;&nbsp;&nbsp;&nbsp;#启动主从\n&nbsp;&nbsp;&nbsp;&nbsp;start&nbsp;slave;\n&nbsp;&nbsp;&nbsp;&nbsp;#查看状态\n&nbsp;&nbsp;&nbsp;&nbsp;show&nbsp;slave&nbsp;status&nbsp;\\G;</pre><p><br/></p>', '2017-12-21 17:15:43', '2018-03-07 17:06:29', null, null, 'http://localhost:8080/blog//upload/image/2017-12-20_084965_timg.jpg', '0', '0', '1', '3', '0', '0', '5', '0', '0', 'Mysql配置主从服务器，MySQL数据库同步，mysql，主从配置', 'Mysql配置主从服务器，配置mysql主从关系，mysql主从同步数据库配置', 'Nszwxiaop');
