INSERT INTO `wp_top` VALUES ('1', 'http://localhost:8080/blog/resources/images/beach.jpg', '渡人如渡己，渡已，亦是渡', '当我们被误解时，会花很多时间去辩白。 但没有用，没人愿意听，大家习惯按自己的所闻、理解做出判别，每个人其实都很固执。 与其努力且痛苦的试图扭转别人的评判，不如默默承受，给大家多一点时间和空间去了解。而我们省下辩解的功夫，去实现自身更久远的人生价值。 其实，渡人如渡己，渡已，亦是渡人。');
INSERT INTO `wp_user` VALUES ('6', 'Nszwxiaop', 'e6HAHStV7ak4lXQGkMl9Bw==', '2018-11-06 15:26:11', null, '1', '0', null, null, null, null, 'admin@test.com', '13131313131');
