-- ----------------------------
-- Procedure structure for getCounts
-- ----------------------------
DROP PROCEDURE IF EXISTS `getCounts`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getCounts`(
	OUT number INT
)
BEGIN
	DECLARE num INT;
	DECLARE countNum CURSOR FOR 
	SELECT COUNT(1) FROM wp_content;
	OPEN countNum;
	FETCH countNum INTO num;
	CLOSE countNum;
	SELECT num INTO number;
END
;;
DELIMITER ;
